column2:
@ApeGuevara Great question.

A combo of both - platforms will onboard artists at scale while unique artists will break the economic envelope open.

I expect the largest secondary markets to come from web3-native artists building bespoke solutions after starting on a key Music NFT platform.

@WinandWoo Unfortunately you need to do more than wait and hope to be accepted.

At the current stage, being present and active in the community carries more weight than an existing artist brand.

Join different communities, support other drops and start making waves in web3.

@KyleSamani Absolutely crushed this.

Agreed that many of the current Music NFT players will become *new* full-stack labels.

Spending all my time figuring out the best way to do this ğŸ’ª

@_garretthughes @BlackDave @mintsongs Great context to have.

Even still, that brings the total to ~1000.

The ratio exemplifies how early we are.

@TrustlessState Scary but (probably) true.

When I see people starting their web3 journey today, they rarely ask how it works, and instead comment on how difficult it is to use.

I'm hopeful we can find a happy medium.
